webpackJsonp([0xfdad99366176],{1157:function(e,t){e.exports={data:{markdownRemark:{html:'<p>I am not a freelancer. But I’ve thought about it a lot; what it would mean and how it might fit into my life now. I’m really happy with my current position but I do often take work home so the whole thought of keeping time to recharge along with regular work and freelancing work is overwhelming. Besides which, though I don’t believe I’m a perfectionist, I do really appreciate the time and space to practice on all the aspects of design because I’m always looking to get better. So that’s why the first tip from <a href="http://www.creativebloq.com/netmag/20-pro-tips-web-design-freelancers-4145555" title="20 Pro Tips for Web Design Freelancers">CreativeBloq’s 20 Pro Tips for Web Design Freelancers</a> really struck me:</p>\n<blockquote>\n<p>Be amazing at something.</p>\n</blockquote>\n<p>Though I may never be the best at anything, that never stops me from trying. I really like to be able to know, whenever I go into an interview situation, that I’m not just some mediocre instructional designer. I’m damn good and I’m working to get better. So for this week’s Elearning Heroes Challenge, I posterized this great tip using a free Photoshop poster mockup. ‘Cause, hey, I don’t do boring.</p>\n<figure>\n  \n  <span class="gatsby-resp-image-wrapper" style="position: relative; display: block; ; max-width: 810px; margin-left: auto; margin-right: auto;">\n    <span class="gatsby-resp-image-background-image" style="padding-bottom: 95.7%; position: relative; bottom: 0; left: 0; background-image: url(&apos;data:image/png;base64,&apos;); background-size: cover; display: block;">\n      <img class="gatsby-resp-image-image" style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;" alt="Favorite Free Lancing Tip" title="" src="/static/favoritefreelancertip-9c57a4cb7405782e4662e2d6b02ec9d4-1626e.png" srcset="/static/favoritefreelancertip-9c57a4cb7405782e4662e2d6b02ec9d4-076ec.png 203w,\n/static/favoritefreelancertip-9c57a4cb7405782e4662e2d6b02ec9d4-7ae34.png 405w,\n/static/favoritefreelancertip-9c57a4cb7405782e4662e2d6b02ec9d4-1626e.png 810w,\n/static/favoritefreelancertip-9c57a4cb7405782e4662e2d6b02ec9d4-95248.png 1000w" sizes="(max-width: 810px) 100vw, 810px">\n    </span>\n  </span>\n  \n</figure>',frontmatter:{date:"December 02, 2014",path:"/blog/elh-challenge-my-favorite-freelancing-tip",title:"ELH Challenge: My Favorite Freelancing Tip",tags:["design","mockup","photoshop","poster","tips"],categories:["Elearning Heroes Challenge","Tips"],featured:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:1.768172888015717,src:"/static/logoColor-c92143fb3723fcd5f12c0d0502759756-81d39.png",srcSet:"/static/logoColor-c92143fb3723fcd5f12c0d0502759756-9a8d1.png 203w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-c53f9.png 405w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-81d39.png 810w,\n/static/logoColor-c92143fb3723fcd5f12c0d0502759756-e81a9.png 900w",sizes:"(max-width: 810px) 100vw, 810px"}}}}}},pathContext:{}}}});
